void * troll_allocate_record(enum TROLL_RECORD_ENUM type)
{
struct parse_type_common_struct * p;	

	switch (type)
	{
		case TROLL_RECORD_INVALID:
			panic("");
			break;
		case TROLL_RECORD_BREAKPOINT:
			p = calloc(1, sizeof(struct bkpt_type_struct));
			break;
		case TROLL_RECORD_DISASSEMBLY_LIST:
			p = calloc(1, sizeof(struct disasm_type_struct));
			break;
		case TROLL_RECORD_VARDISPLAY:
			p = calloc(1, sizeof(struct vardisplay_type_struct));
			break;
		case TROLL_RECORD_MEMDUMP:
			p = calloc(1, sizeof(struct memdump_type_struct));
			break;
		default:
			panic("");
			break;
	}

	if (!p)
		panic("");
	p->type = type;
	return p;
}

void troll_deallocate_record(void * p)
{
struct parse_type_common_struct * t = (struct parse_type_common_struct *) p;

	if (!p)
		return;
	if (t->err.msg)
		free(t->err.msg);
	switch (t->type)
	{
		case TROLL_RECORD_INVALID:
			free(p);
			break;
		case TROLL_RECORD_BREAKPOINT:
			bkpt_destroy(p);
			break;
		case TROLL_RECORD_DISASSEMBLY_LIST:
			disasm_destroy(p);
			break;
		case TROLL_RECORD_VARDISPLAY:
			vardisplay_destroy(p);
			break;
		case TROLL_RECORD_MEMDUMP:
			memdump_destroy(p);
			break;
		default:
			panic("");
			break;
	}
}

void troll_clone_parse_type_common_struct(struct parse_type_common_struct * dest, struct parse_type_common_struct * src)
{
	* dest = * src;
	if (src->err.msg)
		dest->err.msg = strdup(src->err.msg);
}


void * troll_clone(const void * src)
{
struct parse_type_common_struct * t = (struct parse_type_common_struct *) src;

	switch (t->type)
	{
		case TROLL_RECORD_INVALID:
			panic("");
			break;
		case TROLL_RECORD_BREAKPOINT:
			t = bkpt_clone(src);
			break;
		case TROLL_RECORD_DISASSEMBLY_LIST:
			t = disasm_clone(src);
			break;
		case TROLL_RECORD_VARDISPLAY:
			t = vardisplay_clone(src);
			break;
		case TROLL_RECORD_MEMDUMP:
			t = memdump_clone(src);
			break;
		default:
			panic("");
			break;
	}

	return t;
}


static char * parse_header(unsigned long int token[NR_MACHINE_INTERFACE_TOKENS], struct gear_engine_err_struct * err, const char * parse_buf_start) 
{
const char * parse_buf, * s;
int i;

	err->code = GEAR_ERR_NO_ERROR;
	err->msg = 0;
	/* initialize */
	parse_buf = parse_buf_start;
	for (i = 0; i < NR_MACHINE_INTERFACE_TOKENS; i++)
		token[i] = /* ignore errors here */ strtol(parse_buf, &parse_buf, 0);
	/* attempt to parse the error status, if at all present */
	/* skip whitespace, and perhaps any commas */
	parse_buf += strspn(parse_buf, " \t,");
	/* see if this is an error code keyword */
	/*! \todo	this is braindamaged */
	if (strncmp(parse_buf, "ERRCODE", i = sizeof "ERRCODE" - 1))
		/* keyword not found */
		return parse_buf;
	parse_buf += i;
	/* skip characters ahead to the error code */
	parse_buf += strspn(parse_buf, " \t=[");
	/* read error code */
	err->code = (enum GEAR_ENGINE_ERR_ENUM) strtol(parse_buf, &parse_buf, 0);
	/* skip whitespace, and perhaps any commas */
	parse_buf += strspn(parse_buf, " \t,");
	s = parse_buf;
	if (*s++ != '"')
		panic("");
	while (*s)
	{
		if (*s == '\\')
		{
			if (!*++s)
				panic("");
			if (!*++s)
				panic("");
		}
		else if (*s++ == '"')
			break;
	}
	if (!*s)
		panic("");
	if (!(err->msg = (char *) malloc(i = s - parse_buf + 1)))
		panic("");
	memcpy(err->msg, parse_buf, i);
	err->msg[i - 1] = '\0';
	/* skip trailing characters */
	parse_buf = s;
	parse_buf += strspn(s, " \t],");
	return parse_buf;

}

struct parse_type_common_struct * troll_parse(Troll htroll, const char * str)
{
struct parse_type_common_struct s;
void * parse_head;
int i;

	if (!str)
		return 0;
	str = parse_header(s.tokens, &s.err, str);
	parse_head = 0;
	for (i = 0; parsetab[i].record_header; i++)
	{
		if (!strncmp(str, parsetab[i].record_header, parsetab[i].record_header_len))
		{
			YY_BUFFER_STATE buf;

			str += parsetab[i].record_header_len;
			str += strspn(str, "\t ,");
			buf = parsetab[i].lexer_scan_string(str, parsetab[i].scanner);
			if (parsetab[i].parser(&parse_head, htroll, parsetab[i].scanner) && parse_head)
				panic("");

			parsetab[i].lexer_delete_buffer(buf, parsetab[i].scanner);
			break;
		}
	}
	if (!parse_head)
	{
		struct parse_type_common_struct * s1;
		if (!(s1 = calloc(1, sizeof * s1)))
			panic("");
		* s1 = s;
		s1->type = TROLL_RECORD_INVALID;
		parse_head = s1;
	}
	else
	{
		s.type = ((struct parse_type_common_struct *) parse_head)->type;
		*((struct parse_type_common_struct *) parse_head) = s;
	}
	return parse_head;
}

int troll_init(void)
{
int i;
	for (i = 0; parsetab[i].record_header; i++)
		if (parsetab[i].lexer_init(&parsetab[i].scanner))
			return -1;
	return 0;
}

int troll_shutdown(void)
{
int i;
	for (i = 0; parsetab[i].record_header; i++)
		if (parsetab[i].lexer_destroy(parsetab[i].scanner))
			return -1;
	return 0;
}

